import React from 'react';
import {Container, Menu, MenuItem, Logo} from './style.js';
import globe from '../../assets/globe.svg'

function LandingPage() {
  return (
    <Container>
      <Logo>
        <img src={globe} alt=""/>
      </Logo>
    </Container>
  );
}

export default LandingPage;
